function minimumCost(nums: number[]): number {
    const n = nums.length;
    // dp[i][j] will store the minimum cost of dividing the array 
    // into j subarrays from the first i elements.
    let dp: number[][] = Array.from({ length: n + 1 }, () => Array(4).fill(Infinity));

    dp[0][0] = 0; // Base case: no cost for 0 elements and 0 subarrays

    // Iterate over each element in the array
    for (let i = 1; i <= n; i++) {
        // At each position, we try to form 1 to 3 subarrays
        for (let j = 1; j <= 3; j++) {
            // We also check every possible previous position to split the subarray
            for (let k = j - 1; k < i; k++) {
                // Update the dp value with the minimum cost
                dp[i][j] = Math.min(dp[i][j], dp[k][j - 1] + nums[k]);
            }
        }
    }

    // The answer will be the minimum cost to divide the entire array into 3 subarrays
    return dp[n][3];
}
